    # resize control button
    def sizeUi(self, checked):
        if checked:
                self.showMaximized() 
        else:
                self.showNormal()

    # dropdown menu
    def dropMenu(self):
        Menu = QtWidgets.QMenu(self)
        to_main = Menu.addAction("Main Menu")
        to_login = Menu.addAction("Login")
        to_signup = Menu.addAction("Signup")
        Menu.addSeparator()
        to_back = Menu.addAction("Back")
        to_exit = Menu.addAction("Exit")
        source = self.sender()
        action = Menu.exec_(source.mapToGlobal(QtCore.QPoint(source.geometry().x(),source.geometry().y()+source.geometry().height()))) 
        if action == to_main:
            self.stackedWidget.setCurrentIndex(self.stackedMenu["winmenu_main"])
        elif action == to_login:
            self.stackedWidget.setCurrentIndex(self.stackedMenu["winmenu_login"])
        elif action == to_signup:
            self.stackedWidget.setCurrentIndex(self.stackedMenu["winmenu_signup"])
        elif action == to_back:
            if self.stackedWidget.currentIndex() == self.stackedMenu["winmenu_graph"]:
                self.stackedWidget.setCurrentIndex(self.stackedMenu["winmenu_login"])
            elif self.stackedWidget.currentIndex() == self.stackedMenu["winmenu_main"]:
                pass
            else:
                self.stackedWidget.setCurrentIndex(self.stackedMenu["winmenu_main"])
        elif action == to_exit:
            self.close()

