        msg.setText("Message box pop up window")
        msg.setWindowTitle("QMessageBox Example")
        msg.setStandardButtons(QtWidgets.QMessageBox.Ok | QtWidgets.QMessageBox.Cancel)
        msg.move(center)
        msg.exec()  

