    # move whole application when dragging the header
    def mousePressEvent(self, event):
        if self.frame_main_head.geometry().contains(event.pos()):
            self.drag_position = event.globalPos() - self.frameGeometry().topLeft()
            event.accept()
        else:
            super(Ui_MainWindow, self).mousePressEvent(event)

    # move whole application when dragging the header
    def mouseMoveEvent(self, event):
        if event.buttons() and event.buttons() & QtCore.Qt.LeftButton and self.frame_main_head.geometry().contains(event.pos()):
            self.move(event.globalPos() - self.drag_position)
            event.accept()
        else:
            super(Ui_MainWindow, self).mouseMoveEvent(event)

    # maximize window using double click on header
    def mouseDoubleClickEvent(self, event):
        state = self.isMaximized()
        if event.button() == QtCore.Qt.LeftButton and self.frame_main_head.geometry().contains(event.pos()):
            self.sizeUi(not state)

    def changeEvent(self, event):
        if event.type() == QtCore.QEvent.WindowStateChange:
            if self.windowState() & QtCore.Qt.WindowMinimized:
                self.button_database_size.setChecked(False)
                self.button_main_size.setChecked(False)
                self.button_graph_size.setChecked(False)
                self.button_login_size.setChecked(False)
                self.button_signup_size.setChecked(False)
            elif self.windowState() & QtCore.Qt.WindowMaximized:
                self.button_database_size.setChecked(True)
                self.button_main_size.setChecked(True)
                self.button_graph_size.setChecked(True)
                self.button_login_size.setChecked(True)
                self.button_signup_size.setChecked(True)

